import React from 'react';
import instagram from '../images/instagram.png'
import facebook from '../images/facebook.png'
import { Redirect } from 'react-router-dom';

export default function SocialMedia({thisMidea}) {
  return(
    <footer>
      <button
      type="button"
      onClick={ () => {
        console.log("clicou");
        <Redirect to="https://www.instagram.com/evolutionsportcenter/"/>
      } }
      >

        <img 
        alt="Instagran"
        src={ instagram }
        width="50px"
        />
      </button>
      { thisMidea ? (       
        <img
        alt="Facebook"
        src={ facebook }
        width="50px"
        />
        ) : null
      }
    </footer>
  );
}
